import React from "react";
import { useSelector } from "react-redux";
import moment from "moment";

const DateCellRender = () => {

   const {mainPosts} = useSelector((state) => state.post);

   console.log("DateCellRender:::::::::" + JSON.stringify(mainPosts));
   console.log("DateCellRender:::::::::" + JSON.stringify(mainPosts[1].createdAt));

   const getDayInfo = () => {
      let calendarData;
      let diaryMoment;
      for(let i in mainPosts){
         diaryMoment = moment(mainPosts[i].createdAt).format("YYYY-MM-DD");
         if(diaryMoment === moment().format("YYYY-MM-DD")){
            calendarData = [
               {
                  photo: mainPosts[i].Images.src
               }
            ];
         }
      }
      return calendarData || [];
   };

   const dayInfo = getDayInfo();

   const photo = `http://localhost:3065/sean-kong-1dJmkdVuelg-unsplash_1669727155305.jpg`;

 return(
   //  <img src={photo} style={{width:50}} />
  <>
   {dayInfo.map((info) => (
      <img src={`http://localhost:3065/${info.photo}`} />
   ))}
  </>
 );
};

export default DateCellRender;
